import PropTypes from 'prop-types';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import styles from '@material-ui/styles/withStyles';
import FormControl  from '@material-ui/core/FormControl';
import { Button, FormHelperText, Input, InputLabel } from '@material-ui/core';
import { makeStyles } from "@material-ui/core/styles";






export default function Login(){
    return(
        <Box textAlign='center'
        >
           <FormControl className='fromunit'>
                <InputLabel htmlFor="my-input">Username</InputLabel>
                <Input id="my-input" aria-describedby="my-helper-text" />
            </FormControl><br/> 
            <FormControl className='fromunit'>
                <InputLabel htmlFor="my-input">Passwrod</InputLabel>
                <Input id="my-input" aria-describedby="my-helper-text" />
            </FormControl> <br/>
            <Button style={{margin: '10 25', display: "flex"}} className="BookShow" id="bookShow"  variant="contained" color="primary"  >LOGIN</Button>
        </Box>
    )
}
